import React, { useState } from 'react';
import { Table } from 'antd';
import { data } from './data'
import {
  DesktopOutlined,
  FileOutlined,
  PieChartOutlined,
  TeamOutlined,
  UserOutlined,
} from '@ant-design/icons';
import { Breadcrumb, Layout, Menu, theme } from 'antd';
const { Header, Content, Footer, Sider } = Layout;
function getItem(label, key, icon, children) {
  return {
    key,
    icon,
    children,
    label,
  };
}

//side bar
const items = [
  getItem('About us', '1', <PieChartOutlined />),
  getItem('Passwords', '2', <DesktopOutlined />),
  getItem('Groups', 'sub1', <UserOutlined />, [
    getItem('Banking', '3'),
    getItem('Social media', '4'),
    getItem('Home', '5'),
  ])
];

const userItem = [getItem('User', '6', <DesktopOutlined />)];

//table
const columns = [
  {
    title: 'App Name',
    dataIndex: 'app_name',
    key: 'app_name',
  },
  {
    title: 'Username',
    dataIndex: 'username',
    key: 'username',
  },
  {
    title: 'Password',
    dataIndex: 'password',
    key: 'password',
  },
];

//return
const App = () => {
  const [collapsed, setCollapsed] = useState(false);
  const {
    token: { colorBgContainer, borderRadiusLG },
  } = theme.useToken();
  return (
      <Layout
          style={{
            minHeight: '100vh',
          }}
      >
        <Sider collapsible collapsed={collapsed} onCollapse={(value) => setCollapsed(value)}
               style={{ display: 'flex', flexDirection: 'column', justifyContent: 'space-between'}}>
          <div className="demo-logo-vertical" />
          <Menu theme="dark" defaultSelectedKeys={['1']} mode="inline" items={items} />
        </Sider>
        <Layout>
          <Header
              style={{
                padding: 0,
                background: colorBgContainer,
              }}
          />
          <Content
              style={{
                margin: '0 16px',
              }}
          >
            <Breadcrumb
                style={{
                  margin: '16px 0',
                }}
            >
              <Breadcrumb.Item>Group</Breadcrumb.Item>
              <Breadcrumb.Item>Group-name</Breadcrumb.Item>
            </Breadcrumb>
            <div
                style={{
                  padding: 24,
                  minHeight: 360,
                  background: colorBgContainer,
                  borderRadius: borderRadiusLG,
                }}
            >
              <Table dataSource={data} columns={columns} rowKey="app_name" />
            </div>
          </Content>
          <Footer
              style={{
                textAlign: 'center',
              }}
          >
            LockR
          </Footer>
        </Layout>
      </Layout>
  );
};


export default App;
